import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { Box, CircularProgress } from '@mui/material';
import Navbar from './components/Navbar';
import DashboardPage from './components/DashboardPage';
import HedefNisbetPage from './components/HedefNisbetPage';
import GunlukArtisYuzdesiPage from './components/GunlukArtisYuzdesiPage';
import DataTablePage from './components/DataTablePage';
import { getPersonelList, getHedefNisbetList, getGunlukArtisList, Personel, HedefNisbet, GunlukArtis } from './lib/firebase';

const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
  },
  components: {
    MuiCard: {
      styleOverrides: {
        root: {
          borderRadius: 12,
          boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
        },
      },
    },
  },
});

function App() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [personelList, setPersonelList] = useState<Personel[]>([]);
  const [hedefNisbetList, setHedefNisbetList] = useState<HedefNisbet[]>([]);
  const [gunlukArtisList, setGunlukArtisList] = useState<GunlukArtis[]>([]);

  useEffect(() => {
    async function fetchData() {
      try {
        const [personel, hedefNisbet, gunlukArtis] = await Promise.all([
          getPersonelList(),
          getHedefNisbetList(),
          getGunlukArtisList()
        ]);

        setPersonelList(personel);
        setHedefNisbetList(hedefNisbet);
        setGunlukArtisList(gunlukArtis);
        setLoading(false);
      } catch (err) {
        setError('Veri yüklenirken bir hata oluştu. Lütfen Firebase bağlantınızı kontrol edin.');
        setLoading(false);
      }
    }

    fetchData();
  }, []);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', color: 'error.main' }}>
        {error}
      </Box>
    );
  }

  // Verileri tablo formatına dönüştür
  const rows = personelList.map(personel => {
    const hedefNisbet = hedefNisbetList.find(h => h.personelId === personel.id);
    const gunlukArtis = gunlukArtisList.find(g => g.personelId === personel.id);

    return [
      personel.id || '',
      personel.ad,
      personel.soyad,
      personel.departman,
      hedefNisbet?.nisbet.toString() || '0',
      gunlukArtis?.artis.toString() || '0',
      hedefNisbet?.tarih || '',
      gunlukArtis?.tarih || ''
    ];
  });

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
          <Navbar />
          <Box component="main" sx={{ flexGrow: 1, bgcolor: 'background.default' }}>
            <Routes>
              <Route path="/" element={<Navigate to="/dashboard" replace />} />
              <Route path="/dashboard" element={<DashboardPage rows={rows} />} />
              <Route path="/hedef-nisbet" element={<HedefNisbetPage rows={rows} />} />
              <Route path="/gunluk-artis" element={<GunlukArtisYuzdesiPage rows={rows} />} />
              <Route path="/data-table" element={<DataTablePage rows={rows} />} />
            </Routes>
          </Box>
        </Box>
      </Router>
    </ThemeProvider>
  );
}

export default App;
